import React, { Component } from 'react'

export default class Contact extends Component {
  render() {
    return (
      <div className="contact">
        <h1>Contact</h1>
        You can find me on the interwebs! 
        <ul>
          <li><a href="https://www.linkedin.com/in/teiganhockman/" target="_blank">LinkedIn</a></li>
          <li><a href="" target="_blank">Github</a></li>
          <li><a href="" target="_blank">Instagram</a></li>
          <li><a href="mailto:teigan.hockman@gmail.com?Subject=Web%20Development%20Consultation" target="_top">Email Me</a></li>
        </ul>

        I am also available for branding, artistic projects, and hand-drawn illustrations.
      </div>
    )
  }
}
